import MyNavbar from "../../components/MyNavbar/MyNavbar";
function Characters() {
  return (
    <>
      <MyNavbar />
      <h1>Characters page</h1>

      <hr />
      <iframe src="https://giphy.com/embed/o5HKScC1PflLO" width="480" height="269" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/o5HKScC1PflLO">via GIPHY</a></p>
    </>
  );
}
export default Characters;
